import os
import logging
from flask import Flask, request, jsonify
from werkzeug.utils import secure_filename
import pandas as pd
from datetime import datetime
from apscheduler.schedulers.background import BackgroundScheduler

app = Flask(__name__)

# Configure logging
logging.basicConfig(level=logging.ERROR, filename='submission_errors.log')

UPLOAD_FOLDER = 'uploads/'
ALLOWED_EXTENSIONS = {'csv', 'xls', 'xlsx'}

app.config['UPLOAD_FOLDER'] = UPLOAD_FOLDER

# Ensure the upload folder exists
os.makedirs(UPLOAD_FOLDER, exist_ok=True)

# In-memory storage for submissions to prevent double publishing
submissions = set()

def allowed_file(filename):
    return '.' in filename and filename.rsplit('.', 1)[1].lower() in ALLOWED_EXTENSIONS

@app.route('/upload', methods=['POST'])
def upload_file():
    if 'file' not in request.files:
        return jsonify({'error': 'No file part'}), 400
    file = request.files['file']
    if file.filename == '':
        return jsonify({'error': 'No selected file'}), 400
    if file and allowed_file(file.filename):
        filename = secure_filename(file.filename)
        if filename in submissions:
            return jsonify({'error': 'File already submitted'}), 400
        try:
            filepath = os.path.join(app.config['UPLOAD_FOLDER'], filename)
            file.save(filepath)
            submissions.add(filename)
            return jsonify({'success': 'File uploaded successfully'}), 200
        except Exception as e:
            logging.error(f"Error uploading file {filename}: {e}")
            return jsonify({'error': 'File upload failed'}), 500
    return jsonify({'error': 'Invalid file type'}), 400

@app.route('/delete', methods=['DELETE'])
def delete_file():
    filename = request.args.get('filename')
    if filename in submissions:
        submissions.remove(filename)
        filepath = os.path.join(app.config['UPLOAD_FOLDER'], filename)
        if os.path.exists(filepath):
            os.remove(filepath)
        return jsonify({'success': 'File deleted successfully'}), 200
    return jsonify({'error': 'File not found'}), 404

